import React from "react";
import { useGetData } from "./hooks/hooks";
import MapContainer from "./components/MapContainer";
import { css } from "emotion";
import { CircularProgress } from "@material-ui/core";

const DEFAULT_LAT = -21.38917;
const DEFAULT_LNG = -42.69667;

const App = () => {
  const [data, setData] = useGetData();

  if (data && data.length > 0) {
    return (
      <div className={styles.root}>
        <div className={styles.header}>
          <span> Vehicles: O'coffee Brazil</span>
          <img
            src="https://static.wixstatic.com/media/1d7ac3_d76b917700b641be9cb1a75049b5040f~mv2.png/v1/fill/w_102,h_36,al_c,q_85,usm_0.66_1.00_0.01/blue-white-robotics1_3126e5ba-e828-11e9-.webp"
            alt="icon"
          />
        </div>
        <MapContainer
          data={data}
          lat={DEFAULT_LAT}
          lng={DEFAULT_LNG}
          setData={setData}
        />
      </div>
    );
  } else
    return (
      <div className={styles.loader}>
        <CircularProgress size={50} />
      </div>
    );
};

const styles = {
  root: css({
    height: "100vh",
    width: "100vw",
    display: "flex",
    flexDirection: "column",
  }),
  info: css({
    width: "100%",
    display: "flex",
    backgroundColor: "#1d1d1d",
    justifyContent: "center",
  }),
  loader: css({
    position: "fixed",
    top: "50%",
    left: "50%",
    transform: "translate(50%,50%)",
  }),
  header: css({
    background: "#38548c",
    color: "white",
    fontSize: 24,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  }),
};

export default App;
